import { Link } from "react-router-dom";
import {
  Box,
  TextField,
  MenuItem,
  FormControl,
  Typography,
  Grid,
  Divider,
  Chip,
} from "@mui/material";
import { LoadingButton } from "@mui/lab";

const LoginPage = () => {
  return (
    <Box
      component="div"
      sx={{
        display: "flex",
        flexDirection: "column",
        flexWrap: "wrap",
        maxWidth: 600,
        border: ".1px solid lightgray",
        boxShadow: "1px 1px 1px 1px rgba(0, 0, 0, .1)",
        borderRadius: ".3rem",
      }}
      mt={12}
      ml="auto"
      mr="auto"
      p={4}
      gap={2}
    ></Box>
  );
};

export default LoginPage;
